const Layout = () => {
    const nav = () => {
        <ul className="nav">
        a
            <li className="nav-item" className="nav-item">
                <a className="nav-link" href="">Home</a>
            </li>
            <li className="nav-item" className="nav-item">
                <a className="nav-link" href="">Login</a>
            </li>
            <li className="nav-item" className="nav-item">
                <a className="nav-link" href="">Register</a>
            </li>
        </ul>
    }

    return <React.Fragment>
        {nav()}
    </React.Fragment>
}

export default Layout;
